import logo from "./logo.svg";
import "./App.css";
import Header from "./Components/Header";
import AboutMe from "./Components/AboutMe";
import Projects from "./Components/Projects";

function App() {
  return (
    <div className="personal-website">
      <Header></Header>
      <AboutMe></AboutMe>
      <Projects></Projects>
    </div>
  );
}

export default App;
